import React from "react";
import "./CreateAdvogado.css";
import Card from "../../components/Card";
import FormGroup from "../../components/FormGroup";
import axios from "axios";
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';

export default class CreateAdvogado extends React.Component{

    state = {
        login: ' ',
        senha:' ',
        nome:' ',
        cpf:' ',
        inscricao:' ',
        estadoDeEmissao:' ',
        filiacao:' ',
        dataDeNascimento:' '
    }

    cadastrar = async() => {

        await axios.post('http://localhost:8080/api/advogado',
        {
         login: this.state.nome,
         senha: this.state.cartel
        }
        ).then(response => 
         {
           console.log(response);
         }
         ).catch(error => 
           {
             console.log(error.response);
           });
           console.log('request finished');
       }

       cancel = () =>{
        console.log('cancel');
      }

      render(){
        return(

        <div className="container">
                <div className="row">
                    <div className="col-lg-12">
                        <div className="bs-component">
                        <div style={{width: 864, height: 614, position: 'relative'}}>
  <div style={{width: 864, height: 614, left: 0, top: 0, position: 'absolute', background: 'white'}}>
    <div style={{width: 100, height: 40, paddingLeft: 13.2, paddingRight: 13.2, paddingTop: 5.6, paddingBottom: 5.6, left: 742.2, top: 562.2, position: 'absolute', background: '#838383', boxShadow: '0px 1.8px 0.6px -1.2px rgba(0, 0, 0, 0.20)', borderRadius: 9, overflow: 'hidden', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', display: 'inline-flex'}}>
      <div style={{justifyContent: 'center', alignItems: 'center', gap: 4.8, display: 'inline-flex'}}>
        <div style={{color: 'white', fontSize: 12, fontFamily: 'Roboto', fontWeight: '700', textTransform: 'uppercase', lineHeight: 15.6, letterSpacing: 0.276, wordWrap: 'break-word'}}>salvar</div>
      </div>
    </div>
  </div>
</div>


                            <FormGroup label="Login *" htmlFor="inputLogin">
                                <input type="Text" 
                                id="inputLogin"
                                className="form-control"
                                login="Login"
                                onChange={e => this.setState({login: e.target.value})}>
                                </input>
                            </FormGroup>
                            <FormGroup label="Senha: *" htmlFor="inputSenha">
                                <input type="Text" 
                                id="inputSenha"
                                className="form-control"
                                senha="Senha"
                                onChange={e => this.setState({senha: e.target.value})}>
                                </input>
                            </FormGroup>
                            <button onClick={this.cadastrar} type="button" className="btn btn-success">
                                <i className="pi pi-save"></i> Cadastrar
                            </button>
                            <button onClick={this.cancel} type="button" className="btn btn-danger">
                                <i className="pi pi-cancel"></i> Cancelar
                            </button>
                            <ButtonGroup variant="contained" aria-label="Basic button group">
                            <Button>One</Button>
                            <Button>Two</Button>
                            <Button>Three</Button>
                            </ButtonGroup>
                        </div>
                    </div>
                </div>


        </div>
        )
      }

}
